/*Table structure for table `sysloginfo_beifen` */

DROP TABLE IF EXISTS `sysloginfo_beifen`;

CREATE TABLE `sysloginfo_beifen` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `userName` varchar(25) NOT NULL,
  `logDate` datetime NOT NULL DEFAULT '1800-00-00 00:00:00',
  `logs` varchar(1024) NOT NULL,
  `ip` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sysloginfo_beifen` */

/*Table structure for table `t_add_friend_record` */

DROP TABLE IF EXISTS `t_add_friend_record`;

CREATE TABLE `t_add_friend_record` (
  `OBJ_ID` varchar(50) NOT NULL COMMENT '主键',
  `USER_OBJ_ID` varchar(50) NOT NULL COMMENT '发起请求用户主键',
  `FRIEND_OBJ_ID` varchar(50) NOT NULL COMMENT '接受用户请求主键',
  `ADD_STATUS` int(11) NOT NULL DEFAULT '0' COMMENT '接受状态,0:未处理，1:同意2:拒绝',
  `ADD_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间',
  PRIMARY KEY (`OBJ_ID`)
