/*Table structure for table `t_device_login` */

DROP TABLE IF EXISTS `t_device_login`;

CREATE TABLE `t_device_login` (
  `OBJ_ID` varchar(50) NOT NULL,
  `DEVICE_SERIAL_NUMBER` varchar(32) NOT NULL COMMENT '设备序列号',
  `TRANSACTION_CODE` varchar(20) NOT NULL COMMENT '交易码',
  `DEBICE_BAT` int(3) NOT NULL COMMENT '电量',
  `DEVICE_BTS` varchar(200) NOT NULL COMMENT '基站数据',
  `DEVICE_TIMESTAMP` varchar(16) DEFAULT NULL COMMENT '时间戳',
  `LAT` varchar(22) NOT NULL COMMENT '纬度',
  `LON` varchar(22) NOT NULL COMMENT '经度',
  `INSERT_TIME` datetime DEFAULT NULL,
  PRIMARY KEY (`OBJ_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_device_login` */

