/*Table structure for table `t_flying_annal` */

DROP TABLE IF EXISTS `t_flying_annal`;

CREATE TABLE `t_flying_annal` (
  `OBJ_ID` varchar(50) NOT NULL COMMENT '主键',
  `PIGEON_OBJ_ID` varchar(50) DEFAULT NULL COMMENT '鸽环基本信息表-主键',
  `FLYING_START_TIME` timestamp NULL DEFAULT NULL COMMENT '飞行开始时间',
  `FLYING_START_ADDRESS` varchar(200) DEFAULT NULL COMMENT '飞行开始地点',
  `FLYING_END_TIME` timestamp NULL DEFAULT NULL COMMENT '飞行结束时间',
  `FLYING_END_ADDRESS` varchar(200) DEFAULT NULL COMMENT '飞行结束地点',
  `GENERATE_TIME` timestamp NULL DEFAULT NULL COMMENT '记录时间',
  `FLYING_SPEED` varchar(10) DEFAULT NULL COMMENT '速度',
  `FLYING_HEIGHT` varchar(10) DEFAULT NULL COMMENT '高度',
  `SPEED` varchar(10) DEFAULT NULL COMMENT '分速',
  `FLYING_DIRECTION` varchar(10) DEFAULT NULL COMMENT '方向',
  `LONGITUDE` varchar(10) DEFAULT NULL COMMENT '经度',
  `LATITUDE` varchar(10) DEFAULT NULL COMMENT '纬度',
  `SURPLUS_POWER` varchar(10) DEFAULT NULL COMMENT '剩余电量',
  `FLYING_NATION` varchar(100) DEFAULT NULL COMMENT '国家',
  `FLYING_PROVINCE` varchar(100) DEFAULT NULL COMMENT '省份',
  `FLYING_CITY` varchar(100) DEFAULT NULL COMMENT '地市',
  `FLYING_COUNTY` varchar(100) DEFAULT NULL COMMENT '县/区',
  `FLYING_ADDRESS` varchar(1000) DEFAULT NULL COMMENT '详细地址',
  `FLYING_MODE` varchar(10) DEFAULT NULL COMMENT '训放；竞赛；',
  PRIMARY KEY (`OBJ_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='信鸽飞行记录表';

