/*Table structure for table `t_push` */

DROP TABLE IF EXISTS `t_push`;

CREATE TABLE `t_push` (
  `OBJ_ID` varchar(50) NOT NULL COMMENT '主键',
  `PUSH_USER_ID` varchar(50) NOT NULL COMMENT '推送用户主键',
  `RECEIVE_USER_ID` varchar(50) NOT NULL COMMENT '接受用户主键',
  `PUSH_CONTENT` varchar(200) NOT NULL COMMENT '内容',
  `PUSH_STATUS` varchar(50) NOT NULL COMMENT '状态',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '时间',
  PRIMARY KEY (`OBJ_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='推送表';

/*Data for the table `t_push` */

/*Table structure for table `t_user_info` */

DROP TABLE IF EXISTS `t_user_info`;

CREATE TABLE `t_user_info` (
  `OBJ_ID` varchar(32) NOT NULL,
  `CLUB` varchar(255) DEFAULT NULL,
  `DOVECOTE_NAME` varchar(255) DEFAULT NULL,
  `ENROLLMENT_TIME` datetime DEFAULT NULL,
  `FEED_PIGEON_YEAR` int(11) DEFAULT NULL,
  `PIGENO_UNION` varchar(255) DEFAULT NULL,
  `USER_AGE` datetime DEFAULT NULL,
  `USER_CODE` int(11) DEFAULT NULL,
  `USER_PHONE` varchar(255) DEFAULT NULL,
  `USER_PWD` varchar(255) DEFAULT NULL,
  `USER_SEX` varchar(255) DEFAULT NULL,
  `USER_EMAIL` varchar(255) DEFAULT NULL,
  `secret_key` varchar(255) DEFAULT NULL,
  `expired_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `APP_TYPE` varchar(50) NOT NULL COMMENT 'app类型',
  PRIMARY KEY (`OBJ_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

